import React from 'react';
import './Header.css'
import styled from 'styled-components'
import BurgerButton from '../Home/BurgerButton/BurgerButton';


const Header = () => {
    return (
        // <Router>
        <header className='header'>
            <Navbar>
                <div>
                    <a href="/">
                        <img className='logo' src="/Assets/logo.png" alt="logo" />
                    </a>
                </div>
                <ul className='links '>
                    <a href='/'>Home</a>
                    <a href='/'>About</a>
                    <a href='/'>Contact</a>
                </ul>
                <div className='burguer'>
                    <BurgerButton />
                </div>
            </Navbar>
            <svg><svg id="wave" style="transform:rotate(180deg); transition: 0.3s" viewBox="0 0 1440 180" version="1.1" xmlns="http://www.w3.org/2000/svg"><defs><linearGradient id="sw-gradient-0" x1="0" x2="0" y1="1" y2="0"><stop stop-color="rgba(243, 175.812, 62, 1)" offset="0%"></stop><stop stop-color="rgba(255, 230.548, 11, 0.26)" offset="100%"></stop></linearGradient></defs><path style="transform:translate(0, 0px); opacity:1" fill="url(#sw-gradient-0)" d="M0,162L10,150C20,138,40,114,60,93C80,72,100,54,120,42C140,30,160,24,180,27C200,30,220,42,240,66C260,90,280,126,300,138C320,150,340,138,360,120C380,102,400,78,420,84C440,90,460,126,480,144C500,162,520,162,540,150C560,138,580,114,600,99C620,84,640,78,660,84C680,90,700,108,720,114C740,120,760,114,780,117C800,120,820,132,840,129C860,126,880,108,900,84C920,60,940,30,960,15C980,0,1000,0,1020,18C1040,36,1060,72,1080,99C1100,126,1120,144,1140,147C1160,150,1180,138,1200,132C1220,126,1240,126,1260,114C1280,102,1300,78,1320,72C1340,66,1360,78,1380,87C1400,96,1420,102,1430,105L1440,108L1440,180L1430,180C1420,180,1400,180,1380,180C1360,180,1340,180,1320,180C1300,180,1280,180,1260,180C1240,180,1220,180,1200,180C1180,180,1160,180,1140,180C1120,180,1100,180,1080,180C1060,180,1040,180,1020,180C1000,180,980,180,960,180C940,180,920,180,900,180C880,180,860,180,840,180C820,180,800,180,780,180C760,180,740,180,720,180C700,180,680,180,660,180C640,180,620,180,600,180C580,180,560,180,540,180C520,180,500,180,480,180C460,180,440,180,420,180C400,180,380,180,360,180C340,180,320,180,300,180C280,180,260,180,240,180C220,180,200,180,180,180C160,180,140,180,120,180C100,180,80,180,60,180C40,180,20,180,10,180L0,180Z"></path></svg></svg>
           
        </header>
        // </Router>
    );
}

export default Header;

const Navbar = styled.nav`

        height: 100%;
        display: flex;
        align-items: center;
        justify-content: space-between;
        margin: 0;
        /* border-image: url({imageSvg}) stretch; */
       border-bottom: 20px;
        

    .logo{
        width: 50px;
        padding: 10px;
        margin-left: 10px;
        transition: width .5s;
        :hover{
            width: 60px;
        }
    }

    .links {
        a{
            margin-right: 15px;
            text-decoration: none;
            font-weight: bold;
            font-size: 20px;
            color: inherit;
            border-radius: 12px;
            transition: .5s; 

           :hover{
                background-color: black ;
                color: aliceblue;
                padding: 5px;
           }
        }

        @media(max-width: 768px){
                position: absolute;
                top: -1000px;
                right: -1000px;
                margin-left: auto;
                margin-right: auto;
                text-align: center;
        }
    }
    
    .links.active{
        width: 100%;
        display: block;
        position: absolute;
        margin-left: auto;
        margin-right: auto;
        top: 15%;
        left: 15%;
        right: 0;
        text-align: center;
        a{
            color: white;
            display: block;
            margin-bottom: 1rem;
        }
    }

   .burguer{
    @media(min-width: 768px){
        display: none;
    }
    
   }
`
